        localStorage.removeItem('token')
        setLogged(false)
        Navigate("/")
    }
    useEffect(() => {
        if (!localStorage.getItem('token')) {
            Navigate("/")
        }
    }, [logged])
    return (
        <div>
            <button onClick={logout}>Delete</button>
        </div>
    )
}

export default Main
